snippet.textDisplay:
Hahahahahaha! What a positive vibe with lahori touch and contemporary sound. Such a talented trifecta but, the song just didn't work for me at all. I wont skip the song if it comes on the playlist but surely wont go looking for it to play. Rohail Hyatt, you are being missed. Big time. 

Love from India
@Rohwit

